import React, { Component } from 'react'

 class Event extends Component {
    render() {
        return (
            <div>
                <h4>{this.props.name}</h4>
                <ul>
                    <li>Description: {this.props.description}</li>
                    <li>Location: {this.props.location}</li>
                </ul>
            </div>
        )
    }
}

export default Event;
